import Login  from '../component/Login';
import Home from '../component/Home';
import Signup  from '../component/Signup';

const rrr = require('react-router-redux');
const push = rrr.push()

const DISPLAYLOGINPAGE ='DISPLAYLOGINPAGE'
const DISPLAYSIGNUPPAGE ='DISPLAYSIGNUPPAGE'
const DISPLAYHOMEPAGE ='DISPLAYHOMEPAGE'

const initialState = {

    username : 'username ',
    password : 'password',
    success : 'false',
    component : <Login/>
}
const appreducer = (state = initialState,action)=>{
switch(action.type){
  case SUCCESS : console.log("success");return{
     

      username : action.user,
      password : action.pass,
      success : 'true'
    
  }
  case FAILURE : console.log("fail");return{
      ...state ,
      password : "failed"
  }

  case REQUEST :console.log("request");return{
    ...state ,
    username : "ACCESSED"
}
  case DISPLAYSIGNUPPAGE :console.log("display signup page");return{
    ...state ,
    component : <Signup/>
  }

  case DISPLAYLOGINPAGE :console.log("request");return{
    ...state ,
    component : <Login/>
  }

  case DISPLAYHOMEPAGE :console.log("request");return{
    ...state ,
    component : <Home/>
  }
  
  default : return state
}

}

export default appreducer
